INSERT INTO `service` (`id`, `city_id`, `name`, `name_short`, `content`, `content_short`, `duration`, `img`, `price`, `public`, `position`, `slug`) VALUES
(1, 703448, 'RELAX', 'RELAX', '<p>Начинается сеанс с традиционного классического размеренного массажа, цель которого &ndash; раскрепостить клиента, помочь ему максимально расслабиться и забыть на время о насущных проблемах. После того, как общий тонус организма повышается до максимального уровня, настает черед эротической составляющей массажа relax. Только представьте себе: невероятной красоты обнаженная девушка-массажистка плавными движениями покрывает свою кожу ароматными маслами и начинает массировать вас своим волнующим телом &ndash; грудью, упругими ягодицами, животиком.</p>', 'Массаж Боди, стрип', '', '', 390, 1, 2, 'relax-4'),
(2, 713720, 'Relax', 'Relax', '<p>Если Вы ограничены во времени, и Вас интересует быстрый и бурный финал- я буду полностью обнажена, я намажу Вас и себя маслом, я буду ласкать Вас всем своим телом... грудью, животиком, ягодичками. Результат не заставит себя ждать.</p>', 'Стандартный сеанс массажа. Один массажист. Одно расслабление.', '', 'relaks_3.jpg', 390, 1, 1, 'relax-2'),
(3, 709930, 'Relax', 'Relax', '<p>Если Вы ограничены во времени, и Вас интересует быстрый и бурный финал- я буду полностью обнажена, я намажу Вас и себя маслом, я буду ласкать Вас всем своим телом... грудью, животиком, ягодичками. Результат не заставит себя ждать</p>', 'Массаж Боди', '30 минут', 'relaks.jpg', 390, 1, 3, 'relax'),
(4, 709930, 'Butterfly', 'Butterfly', '<p>Ты -мой свет, ты сильный, ты горишь, а я -твой мотылёк... я лечу на твоё пламя, я горю, я хочу дарить тебе прикосновение своих крыльев, я хочу, чтоб ты почувствовал мои нежные губы на твоём теле, я буду целовать тебя, я буду ласкать твоё лицо. Я дарю тебе себя и свою нежность....</p>', 'Массаж с элементами поцелуев. Один мастер, одно расслабление', '', 'baterflyay.jpg', 560, 1, 4, 'butterfly-13'),
(5, 703845, 'Relax', 'Relax', '<p>Если Вы ограничены во времени, и Вас интересует быстрый и бурный финал- я буду полностью обнажена, я намажу Вас и себя маслом, я буду ласкать Вас всем своим телом... грудью, животиком, ягодичками. Результат не заставит себя ждать.</p>', 'Массаж Боди', '30 минут', 'relaks_2.jpg', 390, 1, 1, 'relax-1'),
(6, 709930, 'Я хочу, чтоб ты смотрел', 'Estetic', '<p>Я смотрю на тебя и вижу, как ты меня хочешь... Я завожусь, я глажу свою грудь, животик... я опускаюсь ниже, мне тепло, очень тепло. Смотри на меня, как я себя ласкаю. Или ты хочешь, чтобы я танцевала для тебя ?Не можешь больше? И я не могу! Можно я тебя расслаблю?</p>', 'Программа основана на визуальном контакте. Эстетическая шоу программа. Один мастер. Одно расслабление', '', 'estetik_15.jpg', 680, 1, 6, 'ya-hochu-chtob-ty-smotrel'),
(7, 709930, 'Хочу только его', '', '<p>Хочу с ним поиграть, хочу только его. Хочу! Слышишь? Расслабься, наслаждайся! Б! Не хочу отвлекаться! Хочу, отблагодарить тебя за финал массажем стоп, хочу массировать каждый пальчик ....</p>', 'Массаж Боди', '', 'hochu-tolko-ego.jpg', 990, 0, 7, 'hochu-tolko-ego'),
(8, 709930, 'Pink-show', 'Pink-show', '<p>Я пришла к тебе не одна. Мы вдвоём с подружкой&nbsp; , и мы очень хотим друг друга. Можно я её потрогаю? А можно она поцелует мою грудь? Мы будем ласкать с ней друг друга, пока ты нас не остановишь , и не прикажешь заняться тобой. Мы уже горим! Мы твои! А ты наш! Мы хотим скользить по твоему телу, мы хотим тебя....</p>', '2 мастера, шоу, дабл-массаж боди', '', 'pink-show.jpg', 1200, 1, 8, 'pink-show'),
(9, 709930, 'Maximum', 'Maximum', '<p>Я хочу гладить твою грудь, спину, лицо , я хочу помассировать каждую точечку твоего тела. Я хочу чувствовать тебя, я буду делать это размеренно, пока не дойду до него...&nbsp; Ты не понимаешь, что я умею! Ты узнаешь, что я могу! Это ласки, страсть, 100% внимание тебе и всему твоему телу. И 300 % только ему!!! Твои руки, лицо... я хочу, чтоб ты расслабился по-особенному. Я могу! И я хочу, чтобы ты расслабился дважды. Я хочу!</p>', 'Продолжительная программа. Два этапа. Массаж боди, массаж стоп, массаж лица, массаж спины.', '', 'maximum.jpg', 1550, 1, 9, 'maximum'),
(10, 709930, 'VIP', 'VIP', '<p>Я хочу пройти с обой в душ, мы будем в пене, я нежно сделаю тебе пенный массаж грудью... Затем проведу тебя в комнату и устрою для тебя шоу-программу. Хочу медленно раздеваться, хочу ласкать себя...Давай выпьем шампанского. Я сделаю потрясающий массаж, расслабляя тебя дважды... Иди ко мне ...</p>', 'Пенный массаж Боди. Два этапа', '', 'vip.jpg', 2050, 1, 10, 'vip'),
(11, 709930, 'ALL INCLUSIVE', 'ALL INCLUSIVE', '<p>Особенность этой&nbsp;&nbsp;программы заключается в том, что ты&nbsp;являешься режиссером и хозяином всех действий. Хочешь чередование всех шоу-программ? Или желаешь придумать собственное шоу? А может эксклюзивный Приват-танец... &nbsp;Все, что пожелаешь, потому что ты, и только ты решаешь, что должно происходить, а я очень постараюсь... В подарок две бутылки шампанского</p>', 'Составление программы клиентом по желанию.', '', 'all-inclusive.jpg', 3550, 1, 11, 'all-inclusive'),
(12, 706483, 'Баттерфляй', 'Баттерфляй', '<p>Ты -мой свет, ты сильный, ты горишь, а я -твой мотылёк... я лечу на твоё пламя, я горю, я хочу дарить тебе прикосновение своих крыльев, я хочу, чтоб ты почувствовал мои нежные губы на твоём теле, я буду целовать тебя, я буду ласкать твоё лицо. Я дарю тебе себя и свою нежность....</p>', 'Массаж лица, боди', '', 'baterflyay_2.jpg', 560, 1, 3, 'batterflyay-1'),
(13, 222, 'Я хочу, чтоб ты смотрел', NULL, '<p>Я смотрю на тебя и вижу, как ты меня хочешь... Я завожусь, я глажу свою грудь, животик... я опускаюсь ниже, мне тепло, очень тепло. Смотри на меня, как я себя ласкаю. Не можешь больше? И я не могу! Можно я тебя расслаблю?</p>\r\n<p>В данной программе клиент сам выбирает на какую программу он хочет посмотреть ( пип либо стрип)</p>', NULL, '', 'ya-hochu-chtob-ty-smotrel_2.jpg', 680, 1, 3, 'ya-hochu-chtob-ty-smotrel-1'),
(14, 222, 'Хочу только его', NULL, '<p>Хочу с ним поиграть, хочу только его. Хочу! Слышишь? Расслабься, наслаждайся! Б! Не хочу отвлекаться! Хочу, отблагодарить тебя за финал массажем стоп, хочу массировать каждый пальчик ...</p>\r\n<p>&nbsp;</p>\r\n<p>В данной программе предоставляется выбор финала : либо массаж стоп, либо спинки, либо лица</p>', NULL, '', 'hochu-tolko-ego_2.jpg', 990, 1, 4, 'hochu-tolko-ego-1'),
(15, 706483, 'Pink-show', 'Pink-show', '<p>Я пришла к тебе не одна. Мы вдвоём с подружкой&nbsp; , и мы очень хотим друг друга. Можно я её потрогаю? А можно она поцелует мою грудь? Мы будем ласкать с ней друг друга, пока ты нас не остановишь , и не прикажешь заняться тобой. Мы уже горим! Мы твои! А ты наш! Мы хотим скользить по твоему телу, мы хотим тебя....</p>', '', '', 'pink-show_2.jpg', 1200, 1, 5, 'pink-show-1'),
(16, 706483, 'Maximum', 'Maximum', '<p>Я хочу гладить твою грудь, спину, лицо , я хочу помассировать каждую точечку твоего тела. Я хочу чувствовать тебя, я буду делать это размеренно, пока не дойду до него...&nbsp; Ты не понимаешь, что я умею! Ты узнаешь, что я могу! Это ласки, страсть, 100% внимание тебе и всему твоему телу. И 300 % только ему!!! Твои руки, лицо... я хочу, чтоб ты расслабился по-особенному. Я могу! И я хочу, чтобы ты расслабился дважды. Я хочу!</p>', '', '', 'maximum_2.jpg', 1550, 1, 4, 'maximum-1'),
(17, 222, 'Ролевые массажи', NULL, '<p>Я и мои подружки ждём тебя! Мы хотим поиграть в ролевую игру. Мы готовы! Госпожа уже приготовила плеть, учительница указку, медсестра не знает, куда деть градусник, а горничная уже наклонилась ...</p>', NULL, '', 'rolevye.jpg', 2000, 1, 7, 'rolevye-massazhi'),
(18, 706483, 'VIP', 'VIP', '<p>Я хочу пройти с обой в душ, мы будем в пене, я нежно сделаю тебе пенный массаж грудью... Затем проведу тебя в комнату и устрою для тебя шоу-программу. Хочу медленно раздеваться, хочу ласкать себя...Давай выпьем шампанского. Я сделаю потрясающий массаж, расслабляя тебя дважды... Иди ко мне ...</p>', 'Программа для ценителей Вип-уровня. Массаж,душкоктейль, шоу-программа, подарок.', '', 'vip_2.jpg', 2050, 1, 6, 'vip-1'),
(19, 706483, 'All inclusive', 'All inclusive', '<p>Особенность этой&nbsp;&nbsp;программы заключается в том, что ты&nbsp;являешься режиссером и хозяином всех действий. Хочешь чередование всех шоу-программ? Или желаешь придумать собственное шоу? А может эксклюзивный Приват-танец... &nbsp;Все, что пожелаешь, потому что ты, и только ты решаешь, что должно происходить, а я очень постараюсь... В подарок две бутылки шампанского</p>', 'Длительный массаж, который вы режиссируете сами', '', 'all-inclusive_2.jpg', 3550, 1, 8, 'all-inclusive-1'),
(20, 703448, 'Butterfly', 'Butterfly', '<p>Эротический массаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицами).&nbsp;</p>', 'Массаж Боди, поцелуи. один мастер, один релакс', '', 'baterflyay_15.jpg', 560, 1, 3, 'butterfly-1'),
(21, 703448, 'President', 'President', '<p>Девушка, профессиональная стриптизерша, в откровенном сексуальном белье танцует для вас откровенный стрип-танец. Две массажистки,&nbsp; полностью обнаженные, одновременно делают Вам массаж своими разгоряченными телами, все тело покрывают нежные прикосновения который сопровождается горячими поцелуями. В стоимость программы включена бутылка виски или 2 бутылки шампанского.</p>', '2 мастера, шоу, дабл-массаж боди', '', 'prezident.jpg', 8800, 1, 4, 'president'),
(22, 713717, 'Relax', 'Relax', '<p>Начинается сеанс с традиционного классического размеренного массажа, цель которого &ndash; раскрепостить клиента, помочь ему максимально расслабиться и забыть на время о насущных проблемах. После того, как общий тонус организма повышается до максимального уровня, настает черед эротической составляющей массажа relax. Только представьте себе: невероятной красоты обнаженная девушка-массажистка плавными движениями покрывает свою кожу ароматными маслами и начинает массировать вас своим волнующим телом &ndash; грудью, упругими ягодицами, животиком</p>', 'Стандартный сеанс массажа. Один массажист. Одно расслабление.', '', 'relaks_4.jpg', 390, 1, 1, 'relax-3'),
(23, 713717, 'Butterfly', 'Butterfly', '<p>Эротический массаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицамиассаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицами</p>', 'Массаж с элементами поцелуев. Один мастер, одно расслабление', '', 'baterflyay_3.jpg', 560, 1, 2, 'butterfly'),
(24, 713717, 'All inclusive', 'All inclusive', '<p>Особенность ее заключается в том, что Вы являетесь режиссером и хозяином всех действий. Хотите чередование всех шоу-программ? Или желаете придумать собственное шоу? А может эксклюзивный Приват-танец... Все это от очаровательных, сексуальных и нежных мастеров нашего салона. Все, что пожелаете, потому что Вы, и только Вы решаете, что должно происходить! Программа рассчитана на два часа. В подарок 2 бутылки шаманского, душ-коктейль.&nbsp;</p>', 'Программа, которую Вы режиссируете сами. Один мастер, душ-коктейль, шоу, шампанское.', '', 'all-inclusive_3.jpg', 3550, 1, 3, 'all-inclusive-2'),
(25, 713717, 'Я хочу, чтоб ты смотрел', 'Estetic', '<p>Эта услуга для истинных ценителей неординарных наслаждений, для любителей понаблюдать за чувствительной девушкой, ласкающей свое красивое, нежное тело, доводя себя до экстаза. Это действительно восхитительное действо, которое сильнейшим образом стимулирует половые функции и способствует чувствительности. У вас есть возможность увидеть, как обнаженная девушка медленно ласкает себя, а после она же делает Вам эротический массаж.&nbsp; Данная программа предполагает выбор : вместо пип-шоу, Вы можете выбрать стрип-шоу, в котором девушка будет чувственно обнажать себя в танце. Приват для&nbsp; Вас!<br /> </p>', 'Программа основана на визуальном контакте. Эстетическая шоу программа. Один мастер. Одно расслабление', '', 'estetik.jpg', 680, 1, 4, 'ya-hochu-chtob-ty-smotrel-2'),
(26, 713717, 'Maximum', 'Maximum', '<p>Волшебный массаж лица и головы расслабит Вас и настроит на волну спокойствия. Эта услуга для истинных ценителей неординарных наслаждений, для любителей понаблюдать за чувствительной девушкой, ласкающей свое красивое, нежное тело, после, девушка пригласит Вас в мир эротизма даря Вам безудержный и страстный финал, и подарит вам ни с чем несравнимое чувство удовлетворенности и умиротворения, так как особое внимание в этом массаже уделяется эрогенным зонам Вашего тела. Так же, Вы выбираете второй вид расслабления по желанию</p>', 'Массаж с двумя расслаблениями, по разным методикам. Массаж лица либо спинки', '', 'maximum_3.jpg', 1550, 1, 5, 'maximum-2'),
(27, 713717, 'Pink-show', 'Pink-show', '<p>Этот вид массажа подарит Вам поистине острые ощущения! Две подружки массажистки начнут свою игру с взаимных ласк и шалостей&hellip;&nbsp;Они будут ласкать тела друг -друга &hellip; поцелуи, медленные скольжения, вздохи, любовь, страсть&hellip;<br /> Представьте, что сделают с Вами эти заведенные кошечки! В два раза больше ощущений и удовольствия!!! В два раза больше эмоций и страсти!&nbsp;Массажные манипуляции выполняются полностью обнажёнными телами массажисток с применением масел и кремов. Ваше тело расслабляется, а чувства обостряются до предела</p>', 'Два мастера, шоу программа высокого уровня. Одно расслабление', '', 'pink-show_3.jpg', 1200, 1, 6, 'pink-show-2'),
(28, 713717, 'VIP', 'VIP', '<p>Предлагаем Вашему вниманию программу для тех, кто знает, что такое роскошь и готов к незабываемым впечатлениям! Здесь объединены несколько самых популярных программ нашего салона! Стрип-шоу открывает первую волну эмоций, затем приходит черед пип-шоу: девушка начинает ласкать себя, доводя до экстаза на ваших глазах. В этой программе Вы расслабляетесь дважды. Два взрыва чувств, страсти, неги&hellip; Затем Вас ждет великолепный душ с девушкой. О, &mdash; это сказочное удовольствие!&nbsp;&nbsp;<br /> </p>', 'Массаж лица, шоу, полный массаж, душ-коктейль, шампанское', '', 'vip_3.jpg', 2050, 1, 7, 'vip-2'),
(29, 713717, 'PREZEDENT', 'PREZEDENT', '<p>Это 3-х часовая программа в которую входит: Три пип - шоу, три лесби-шоу и три стрип-шоу .Так же входит 3 релакса.&nbsp;Девушка, профессиональная стриптизерша, в откровенном сексуальном белье танцует для вас откровенный стрип-танец. Две массажистки, полностью обнаженные, одновременно делают Вам массаж своими разгоряченными телами, все тело покрывают нежные прикосновения который сопровождается горячими поцелуями.</p>', '3 мастера, 3 расслабления, 3 вида трех шоу-программ, тройной душ-коктейль, бутылка виски.', '3 часа', 'prezident_2.jpg', 8800, 1, 8, 'prezedent'),
