(38, 687700, 'Relax', 'Relax', '<p>Начинается сеанс с традиционного классического размеренного массажа, цель которого &ndash; раскрепостить клиента, помочь ему максимально расслабиться и забыть на время о насущных проблемах. После того, как общий тонус организма повышается до максимального уровня, настает черед эротической составляющей массажа relax. Только представьте себе: невероятной красоты обнаженная девушка-массажистка плавными движениями покрывает свою кожу ароматными маслами и начинает массировать вас своим волнующим телом &ndash; грудью, упругими ягодицами, животиком.</p>', 'Стандартный сеанс массажа. Один массажист. Одно расслабление.', '', 'relaks_6.jpg', 390, 1, 1, 'relax-6'),
(39, 687700, 'Butterfly', 'Butterfly', '<p>Эротический массаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицамиассаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицами.</p>', 'Массаж с элементами поцелуев. Один мастер, одно расслабление', '', 'baterflyay_5.jpg', 560, 1, 2, 'butterfly-3'),
(40, 687700, 'All inclusive', 'All inclusive', '<p>Особенность ее заключается в том, что Вы являетесь режиссером и хозяином всех действий. Хотите чередование всех шоу-программ? Или желаете придумать собственное шоу? А может эксклюзивный Приват-танец... Все это от очаровательных, сексуальных и нежных мастеров нашего салона. Все, что пожелаете, потому что Вы, и только Вы решаете, что должно происходить! Программа рассчитана на два часа. В подарок 2 бутылки шаманского, душ-коктейль.&nbsp;</p>', 'Программа, которую Вы режиссируете сами. Один мастер, душкоктейль, шоу, шампанское.', '', 'all-inclusive_5.jpg', 3550, 1, 3, 'all-inclusive-4'),
(41, 687700, 'Я хочу, чтоб ты смотрел', 'Estetic', '<p>Эта услуга для истинных ценителей неординарных наслаждений, для любителей понаблюдать за чувствительной девушкой, ласкающей свое красивое, нежное тело, доводя себя до экстаза. Это действительно восхитительное действо, которое сильнейшим образом стимулирует половые функции и способствует чувствительности. У вас есть возможность увидеть, как обнаженная девушка медленно ласкает себя, а после она же делает Вам эротический массаж.&nbsp; Данная программа предполагает выбор : вместо пип-шоу, Вы можете выбрать стрип-шоу, в котором девушка будет чувственно обнажать себя в танце. Приват для&nbsp; Вас!</p>', 'Программа основана на визуальном контакте. Эстетическая шоу программа. Один мастер. Одно расслабление', '', 'estetik_3.jpg', 680, 1, 4, 'ya-hochu-chtob-ty-smotrel-3'),
(42, 687700, 'Maximum', 'Maximum', '<p>Волшебный массаж лица и головы расслабит Вас и настроит на волну спокойствия. Эта услуга для истинных ценителей неординарных наслаждений, для любителей понаблюдать за чувствительной девушкой, ласкающей свое красивое, нежное тело, после, девушка пригласит Вас в мир эротизма даря Вам безудержный и страстный финал, и подарит вам ни с чем несравнимое чувство удовлетворенности и умиротворения, так как особое внимание в этом массаже уделяется эрогенным зонам Вашего тела. Так же, Вы выбираете второй вид расслабления по желанию</p>', 'Массаж с двумя расслаблениями, по разным методикам. Массаж лица либо спинки', '', 'maximum_5.jpg', 1550, 1, 5, 'maximum-4'),
