(58, 704508, 'VIP', 'VIP', '<p>Предлагаем Вашему вниманию программу для тех, кто знает, что такое роскошь и готов к незабываемым впечатлениям! Здесь объединены несколько самых популярных программ нашего салона! Стрип-шоу открывает первую волну эмоций, затем приходит черед пип-шоу: девушка начинает ласкать себя, доводя до экстаза на ваших глазах. В этой программе Вы расслабляетесь дважды. Два взрыва чувств, страсти, неги&hellip; Затем Вас ждет великолепный душ с девушкой. О, &mdash; это сказочное удовольствие!&nbsp;&nbsp;</p>', 'Массаж лица, шоу, полный массаж, душкоктейль, шампанское', '', 'vip_7.jpg', 2050, 1, 7, 'vip-6'),
(59, 704508, 'PREZEDENT', 'PREZEDENT', '<p>Это 3-х часовая программа в которую входит: Три пип - шоу, три лесби-шоу и три стрип-шоу .Так же входит 3 релакса.&nbsp;Девушка, профессиональная стриптизерша, в откровенном сексуальном белье танцует для вас откровенный стрип-танец. Две массажистки, полностью обнаженные, одновременно делают Вам массаж своими разгоряченными телами, все тело покрывают нежные прикосновения который сопровождается горячими поцелуями.</p>', '3 мастера, 3 расслабления, 3 вида трех шоупрограмм, тройной душкоктейль, бутылка виски', '', 'prezident_6.jpg', 8800, 1, 8, 'prezedent-3'),
(60, 704147, 'Relax', 'Relax', '<p>Начинается сеанс с традиционного классического размеренного массажа, цель которого &ndash; раскрепостить клиента, помочь ему максимально расслабиться и забыть на время о насущных проблемах. После того, как общий тонус организма повышается до максимального уровня, настает черед эротической составляющей массажа relax. Только представьте себе: невероятной красоты обнаженная девушка-массажистка плавными движениями покрывает свою кожу ароматными маслами и начинает массировать вас своим волнующим телом &ndash; грудью, упругими ягодицами, животиком</p>', 'Стандартный сеанс массажа. Один массажист. Одно расслабление.', '', 'relaks_8.jpg', 390, 1, 1, 'relax-8'),
(61, 704147, 'Butterfly', 'Butterfly', '<p>Эротический массаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицамиассаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицами</p>', 'Массаж с элементами поцелуев. Один мастер, одно расслабление', '', 'baterflyay_7.jpg', 560, 1, 2, 'butterfly-5'),
(62, 704147, 'All inclusive', 'All inclusive', '<p>Особенность ее заключается в том, что Вы являетесь режиссером и хозяином всех действий. Хотите чередование всех шоу-программ? Или желаете придумать собственное шоу? А может эксклюзивный Приват-танец... Все это от очаровательных, сексуальных и нежных мастеров нашего салона. Все, что пожелаете, потому что Вы, и только Вы решаете, что должно происходить! Программа рассчитана на два часа. В подарок 2 бутылки шаманского, душ-коктейль.&nbsp;</p>', 'Программа, которую Вы режиссируете сами. Один мастер, душкоктейль, шоу, шампанское', '', 'all-inclusive_8.jpg', 3550, 1, 3, 'all-inclusive-7'),
(63, NULL, 'Я хочу, чтоб ты смотрел', 'Estetic', '<p>Эта услуга для истинных ценителей неординарных наслаждений, для любителей понаблюдать за чувствительной девушкой, ласкающей свое красивое, нежное тело, доводя себя до экстаза. Это действительно восхитительное действо, которое сильнейшим образом стимулирует половые функции и способствует чувствительности. У вас есть возможность увидеть, как обнаженная девушка медленно ласкает себя, а после она же делает Вам эротический массаж.&nbsp; Данная программа предполагает выбор : вместо пип-шоу, Вы можете выбрать стрип-шоу, в котором девушка будет чувственно обнажать себя в танце. Приват для&nbsp; Вас!</p>', 'Программа основана на визуальном контакте. Эстетическая шоу программа. Один мастер. Одно расслабление', '', 'estetik_6.jpg', 680, 1, 1, 'ya-hochu-chtob-ty-smotrel-6'),
