(77, 701822, ' Butterfly', ' Butterfly', '<p>Эротический массаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицамиассаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицами</p>', 'Массаж с элементами поцелуев. Один мастер, одно расслабление', '', 'baterflyay_9.jpg', 560, 1, 2, 'butterfly-7'),
(78, 701822, 'All inclusive', 'All inclusive', '<p>Особенность ее заключается в том, что Вы являетесь режиссером и хозяином всех действий. Хотите чередование всех шоу-программ? Или желаете придумать собственное шоу? А может эксклюзивный Приват-танец... Все это от очаровательных, сексуальных и нежных мастеров нашего салона. Все, что пожелаете, потому что Вы, и только Вы решаете, что должно происходить! Программа рассчитана на два часа. В подарок 2 бутылки шаманского, душ-коктейль.&nbsp;</p>', 'Программа, которую Вы режиссируете сами. Один мастер, душ-коктейль, шоу, шампанское.', '', 'all-inclusive_10.jpg', 3550, 1, 3, 'all-inclusive-9'),
(79, 701822, 'Я хочу, чтоб ты смотрел', 'Estetic', '<p>Эта услуга для истинных ценителей неординарных наслаждений, для любителей понаблюдать за чувствительной девушкой, ласкающей свое красивое, нежное тело, доводя себя до экстаза. Это действительно восхитительное действо, которое сильнейшим образом стимулирует половые функции и способствует чувствительности. У вас есть возможность увидеть, как обнаженная девушка медленно ласкает себя, а после она же делает Вам эротический массаж.&nbsp; Данная программа предполагает выбор : вместо пип-шоу, Вы можете выбрать стрип-шоу, в котором девушка будет чувственно обнажать себя в танце. Приват для&nbsp; Вас!</p>', 'Программа основана на визуальном контакте. Эстетическая шоу программа. Один мастер. Одно расслабление', '', 'estetik_9.jpg', 680, 1, 4, 'ya-hochu-chtob-ty-smotrel-9'),
(80, 701822, 'Maximum', 'Maximum', '<p>Волшебный массаж лица и головы расслабит Вас и настроит на волну спокойствия. Эта услуга для истинных ценителей неординарных наслаждений, для любителей понаблюдать за чувствительной девушкой, ласкающей свое красивое, нежное тело, после, девушка пригласит Вас в мир эротизма даря Вам безудержный и страстный финал, и подарит вам ни с чем несравнимое чувство удовлетворенности и умиротворения, так как особое внимание в этом массаже уделяется эрогенным зонам Вашего тела. Так же, Вы выбираете второй вид расслабления по желанию</p>', 'Массаж с двумя расслаблениями, по разным методикам. Массаж лица либо спинки', '', 'maximum_10.jpg', 1550, 1, 5, 'maximum-9'),
(81, 701822, 'Pink-show', 'Pink-show', '<p>Этот вид массажа подарит Вам поистине острые ощущения! Две подружки массажистки начнут свою игру с взаимных ласк и шалостей&hellip;&nbsp;Они будут ласкать тела друг -друга &hellip; поцелуи, медленные скольжения, вздохи, любовь, страсть&hellip;<br />Представьте, что сделают с Вами эти заведенные кошечки! В два раза больше ощущений и удовольствия!!! В два раза больше эмоций и страсти!&nbsp;Массажные манипуляции выполняются полностью обнажёнными телами массажисток с применением масел и кремов. Ваше тело расслабляется, а чувства обостряются до предела</p>', 'Два мастера, шоу программа высокого уровня. Одно расслабление', '', 'pink-show_10.jpg', 1200, 1, 6, 'pink-show-9'),
(82, 701822, 'VIP', 'VIP', '<p>Предлагаем Вашему вниманию программу для тех, кто знает, что такое роскошь и готов к незабываемым впечатлениям! Здесь объединены несколько самых популярных программ нашего салона! Стрип-шоу открывает первую волну эмоций, затем приходит черед пип-шоу: девушка начинает ласкать себя, доводя до экстаза на ваших глазах. В этой программе Вы расслабляетесь дважды. Два взрыва чувств, страсти, неги&hellip; Затем Вас ждет великолепный душ с девушкой. О, &mdash; это сказочное удовольствие!&nbsp;&nbsp;</p>', 'Массаж лица, шоу, полный массаж, душ-коктейль, шампанское', '', 'vip_10.jpg', 2050, 1, 7, 'vip-9'),
(83, 701822, 'PREZEDENT', 'PREZEDENT', '<p>Это 3-х часовая программа в которую входит: Три пип - шоу, три лесби-шоу и три стрип-шоу .Так же входит 3 релакса.&nbsp;Девушка, профессиональная стриптизерша, в откровенном сексуальном белье танцует для вас откровенный стрип-танец. Две массажистки, полностью обнаженные, одновременно делают Вам массаж своими разгоряченными телами, все тело покрывают нежные прикосновения который сопровождается горячими поцелуями.</p>', '3 мастера, 3 расслабления, 3 вида трех шоу-программ, тройной душ-коктейль, бутылка виски.', '', 'prezident_9.jpg', 8800, 1, 8, 'prezedent-6'),
