(97, 696643, 'Pink-show', 'Pink-show', '<p>Этот вид массажа подарит Вам поистине острые ощущения! Две подружки массажистки начнут свою игру с взаимных ласк и шалостей&hellip;&nbsp;Они будут ласкать тела друг -друга &hellip; поцелуи, медленные скольжения, вздохи, любовь, страсть&hellip;<br />Представьте, что сделают с Вами эти заведенные кошечки! В два раза больше ощущений и удовольствия!!! В два раза больше эмоций и страсти!&nbsp;Массажные манипуляции выполняются полностью обнажёнными телами массажисток с применением масел и кремов. Ваше тело расслабляется, а чувства обостряются до предела</p>', 'Два мастера, шоу программа высокого уровня. Одно расслабление', '', 'pink-show_12.jpg', 1200, 1, 6, 'pink-show-11'),
(98, 696643, 'VIP', 'VIP', '<p>Предлагаем Вашему вниманию программу для тех, кто знает, что такое роскошь и готов к незабываемым впечатлениям! Здесь объединены несколько самых популярных программ нашего салона! Стрип-шоу открывает первую волну эмоций, затем приходит черед пип-шоу: девушка начинает ласкать себя, доводя до экстаза на ваших глазах. В этой программе Вы расслабляетесь дважды. Два взрыва чувств, страсти, неги&hellip; Затем Вас ждет великолепный душ с девушкой. О, &mdash; это сказочное удоволь</p>', 'Массаж лица, шоу, полный массаж, душ-коктейль, шампанское', '', 'vip_12.jpg', 2050, 1, 7, 'vip-11'),
(99, 696643, 'PREZEDENT', 'PREZEDENT', '<p>Это 3-х часовая программа в которую входит: Три пип - шоу, три лесби-шоу и три стрип-шоу .Так же входит 3 релакса.&nbsp;Девушка, профессиональная стриптизерша, в откровенном сексуальном белье танцует для вас откровенный стрип-танец. Две массажистки, полностью обнаженные, одновременно делают Вам массаж своими разгоряченными телами, все тело покрывают нежные прикосновения который сопровождается горячими поцелуями.</p>', '3 мастера, 3 расслабления, 3 вида трех шоу-программ, тройной душ-коктейль, бутылка виски.', '', 'prezident_11.jpg', 8800, 1, 8, 'prezedent-8'),
(100, 692194, 'Relax', 'Relax', '<p>Начинается сеанс с традиционного классического размеренного массажа, цель которого &ndash; раскрепостить клиента, помочь ему максимально расслабиться и забыть на время о насущных проблемах. После того, как общий тонус организма повышается до максимального уровня, настает черед эротической составляющей массажа relax. Только представьте себе: невероятной красоты обнаженная девушка-массажистка плавными движениями покрывает свою кожу ароматными маслами и начинает массировать вас своим волнующим телом &ndash; грудью, упругими ягодицами, животиком</p>', 'Стандартный сеанс массажа. Один массажист. Одно расслабление.', '', 'relaks_12.jpg', 390, 1, 1, 'relax-12'),
(101, 692194, 'Butterfly', 'Butterfly', '<p>Эротический массаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицамиассаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицами</p>', 'Массаж с элементами поцелуев. Один мастер, одно расслабление', '', 'baterflyay_12.jpg', 560, 1, 2, 'butterfly-10'),
