(117, 713719, 'Butterfly', 'Butterfly', '<p>Эротический массаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицамиассаж, вначале которого девушка своими нежными поцелуями и ласками приглашает Вас в свой мир чувствительности и эротизма. Массаж проходит в интимной, теплой обстановке и является очень нежным и легким массажем всего тела. Он выполняется не только поцелуями. Но и мягонькими кончиками пальцев очаровательной массажистки. Заканчивается массаж эротической частью &ndash; релакс-массажем (массаж грудью, животиком, ягодицами</p>', 'Массаж с элементами поцелуев. Один мастер, одно расслабление', '', 'baterflyay_14.jpg', 560, 1, 2, 'butterfly-12'),
(118, 713719, 'All inclusive', 'All inclusive', '<p>Особенность ее заключается в том, что Вы являетесь режиссером и хозяином всех действий. Хотите чередование всех шоу-программ? Или желаете придумать собственное шоу? А может эксклюзивный Приват-танец... Все это от очаровательных, сексуальных и нежных мастеров нашего салона. Все, что пожелаете, потому что Вы, и только Вы решаете, что должно происходить! Программа рассчитана на два часа. В подарок 2 бутылки шаманского, душ-коктейль.&nbsp;</p>', 'Программа, которую Вы режиссируете сами. Один мастер, душ-коктейль, шоу, шампанское.', '', 'all-inclusive_15.jpg', 3550, 1, 3, 'all-inclusive-14'),
(119, 713720, 'Я хочу, чтоб ты смотрел', 'Estetic', '<p>Эта услуга для истинных ценителей неординарных наслаждений, для любителей понаблюдать за чувствительной девушкой, ласкающей свое красивое, нежное тело, доводя себя до экстаза. Это действительно восхитительное действо, которое сильнейшим образом стимулирует половые функции и способствует чувствительности. У вас есть возможность увидеть, как обнаженная девушка медленно ласкает себя, а после она же делает Вам эротический массаж.&nbsp; Данная программа предполагает выбор : вместо пип-шоу, Вы можете выбрать стрип-шоу, в котором девушка будет чувственно обнажать себя в танце. Приват для&nbsp; Вас!</p>', 'Программа основана на визуальном контакте. Эстетическая шоу программа. Один мастер. Одно расслабление', '', 'estetik_14.jpg', 680, 1, 6, 'ya-hochu-chtob-ty-smotrel-14'),
